<div class="c230_93"> 
<div id="v230.93.1"><span class="H3068 s">The LORD</span><span class="H4427 s"> reigneth</span><span class="H3847 s">, he is clothed</span><span class="H1348 s"> with majesty</span><span class="H3068 s">; the LORD</span><span class="H3847 s"> is clothed</span><span class="H5797 s"> with strength</span><span class="H247 s">, <i>wherewith</i> he hath girded</span><span class="H8398 s"> himself: the world</span><span class="H3559 s"> also is stablished</span><span class="H4131 s">, that it cannot be moved</span>.</div> 
<div id="v230.93.2"><span class="H3678 s">Thy throne</span><span class="H3559 s"> <i>is</i> established</span><span class="H227 s"> of old</span><span class="H5769 s">: thou <i>art</i> from everlasting</span>. <span class="notes">Notes by the 1611 King James Bible Translators: (of old: Heb. from then)</span></div> 
<div id="v230.93.3"><span class="H5104 s">The floods</span><span class="H5375 s"> have lifted up</span><span class="H3068 s">, O LORD</span><span class="H5104 s">, the floods</span><span class="H5375 s"> have lifted up</span><span class="H6963 s"> their voice</span><span class="H5104 s">; the floods</span><span class="H5375 s"> lift up</span><span class="H1796 s"> their waves</span>.</div> 
<div id="v230.93.4"><span class="H3068 s">The LORD</span><span class="H4791 s"> on high</span><span class="H117 s"> <i>is</i> mightier</span><span class="H6963 s"> than the noise</span><span class="H7227 s"> of many</span><span class="H4325 s"> waters</span><span class="H117 s">, <i>yea, than</i> the mighty</span><span class="H4867 s"> waves</span><span class="H3220 s"> of the sea</span>.</div> 
